item_detail: function(item)
*/

rowset.then(function(rowset) {
    var rows = Array();
    rowset.forEach(function(row) {
        rows.push(row);
    });

    w.html(widget('layout:list_view', {
        items: rows,
        item_name: item_name,
        item_detail: function(row) {
            return widget('row_display', {
                row: row,
		        row_title: item_name,
                editable: true
            });
        }
    }));
});

